import{C as t}from"./chunks/CompareData.b66c57a3.js";import{o as l,c as i,a,u as n,b as e,d as o}from"./app.2c326d15.js";const s=[{id:"Dialogue Text/0x01000072000071CF",source:'"Then *I* will make you different. I will make your lungs glow. I will make you last *forever*."',target:'"Pak tě *já* udělám jinou. Rozzářím ti plíce. Udělám tě *věčnou*."',deepl:'"Pak tě *já* udělám jiným. Já ti rozzářím plíce. Díky mně vydržíš navždy."',lindat:'"Pak tě *já* učiním jiným. Zazáří ti plíce. Zařídím, abys vydržel *navždy*."',google:'"Pak tě *já* udělám jiným. Rozzářím ti plíce. Udělám ti to *navždy*."'},{id:"Dialogue Text/0x0100006400009FC5",source:'"*Mon dieu*, you set it on fire!" He looks at the plaza. "What kind of a policeman are you?"',target:'"*Mon dieu*, vy jste to zapálil!" Pohlédne na náměstí. "Co jste to za policistu?"',deepl:'"*Mon dieu*, ty jsi to zapálil!" Podívá se na náměstí. "Co jsi to za policistu?"',lindat:'"*Mon dieu*, vy jste to zapálil!" Podívá se na náměstí. "Co jste to za policistu?"',google:'"*Mon dieu*, ty jsi to zapálil!" Dívá se na náměstí. "Jaký jste policista?"'},{id:"Dialogue Text/0x0100005A0000701F",source:`"Okay, if it floats your boat I'll be more like Contact Mike and less like me."`,target:'"Fajn, pokud ti to uknejší duši tak budu víc jako Kontaktní Mik a méně jako já."',deepl:'"Dobře, jestli ti to vyhovuje, budu víc jako kontaktní Mike a míň jako já."',lindat:'"Dobře, když to bude plout tvou lodí, budu víc jako Kontakt Mike a méně jako já."',google:'"Dobře, jestli to bude plavat na vaší lodi, budu víc jako Kontakt Mike a méně jako já."'},{id:"Dialogue Text/0x0100006B00001934",source:`"Yeah, sure came close," Chester mutters in return, then turns to the rapt listener. "Alright, so I was tailing this guy called 'Francis the Shoe'..." The inside of the motor carriage is thick with cigarette smoke. Outside, it starts to rain...`,target:'"Jo, to bylo o fous," zamumlá Chester na oplátku a pak se otočí k nadšenému posluchači. "Dobře, tak jsem sledoval jednoho chlápka, co si říkal "Franta Bota"..." Vnitřek motorového vozu je zahlcený cigaretovým kouřem. Venku začíná pršet...',deepl:`"Jo, to bylo o fous," zamumlá Chester na oplátku a pak se otočí k nadšenému posluchači. "Dobře, tak jsem sledoval chlápka, co si říkal 'Francis Bota'..." Vnitřek motorového vozu je zahlcený cigaretovým kouřem. Venku začíná pršet...`,lindat:'"Jo, to bylo o fous," zamumlá Chester na oplátku a pak se otočí k uchvácenému posluchači. "No dobře, tak jsem sledoval chlápka, co se jmenoval Francis Bota..." Vnitřek vozu je hustý cigaretovým kouřem. Venku začíná pršet...',google:'"Jo, určitě se to přiblížilo," zamumlal Chester na oplátku a pak se otočil k zaujatému posluchači. "Dobře, takže jsem sledoval toho chlapíka, který se jmenoval ‚František Bota‘..." Vnitřek motorového vagónu je plný cigaretového kouře. Venku začíná pršet...'},{id:"Dialogue Text/0x0100004C000118DD",source:"Present a solid theory about why Ruby could've done it.",target:"Předlož solidní teorii o tom, proč to Ruby mohla udělat.",deepl:"Předložte solidní teorii o tom, proč to Ruby mohl udělat.",lindat:"Předložte solidní teorii o tom, proč to Ruby mohla udělat.",google:"Předložte solidní teorii o tom, proč to Ruby mohla udělat."},{id:"Dialogue Text/0x0100002F00011A1F",source:'"I want to buy the *Wirrâl* game."',target:'"Chci si koupit hru *Wirrâl."',deepl:'"Chci si koupit hru *Wirrâl*."',lindat:'"Chci si koupit hru *Wirrâl*."',google:'"Chci si koupit hru *Wirrâl*."'},{id:"Dialogue Text/0x010000450000B775",source:'"Okay -- neutral."',target:'"Dobře - neutrál."',deepl:'"Dobře - neutrální."',lindat:'"Dobrá – neutrální."',google:'"Dobře - neutrální."'},{id:"Dialogue Text/0x0100002B00004226",source:"Less talk, more feeling. Keep your eyes closed, soak in the closeness. See what the feeling entails.",target:"Méně slov, více pocitů. Nech oči zavřené, nasákni blízkostí. Zjisti, co ten pocit znamená.",deepl:"Méně řečí, více pocitů. Mějte zavřené oči a nasávejte tu blízkost. Sledujte, co ten pocit obnáší.",lindat:"Méně řečí, více citů. Mějte zavřené oči, nasávejte blízkost. Uvidíte, co ten pocit obnáší.",google:"Méně řečí, více pocitů. Mějte zavřené oči, ponořte se do blízkosti. Podívejte se, co ten pocit obnáší."},{id:"Dialogue Text/0x01000045000133CE",source:'"His eye colour?"',target:'"Jakou měl barvu očí?"',deepl:'"Jakou má barvu očí?"',lindat:'"Barva očí?"',google:'"Barva jeho očí?"'},{id:"tooltip2/0x010000040000C54F",source:"The lights are on!",target:"Světla svítí!",deepl:"Světla svítí!",lindat:"Svítí se tu!",google:"Světla svítí!"},{id:"Dialogue Text/0x0100009200003374",source:'"Good, we should take a look at that library card after this is done."',target:'"Dobrá, až tu skončíme, měli bychom se podívat na tu kartičku do knihovny."',deepl:'"Dobře, měli bychom se podívat na ten průkaz do knihovny, až to bude hotové."',lindat:'"Dobře, měli bychom se podívat na ten průkaz do knihovny, až to bude hotové."',google:'"Dobrá, měli bychom se podívat na ten čtenářský průkaz, až to bude hotové."'},{id:"Dialogue Text/0x0100000600007368",source:'"What has entroponetics changed then?"',target:'"Co  tedy změnila entroponetika?"',deepl:'"Co se tedy změnilo v entroponetice?"',lindat:'"Co se tehdy změnilo v entroponetice?"',google:'"Co se tedy entroponetika změnila?"'},{id:"WEEKDAY_6",source:"Saturday",target:"Sobota",deepl:"Sobota",lindat:"Sobota",google:"sobota"},{id:"Dialogue Text/0x0100000600001AB8",source:"The sheer willpower in him MUST be making some dent in their incredulity. Some part of them must be thinking...",target:"Ta čirá síla vůle MUSÍ nějak narušovat jejich nedůvěřivost. Nějaká jejich část si musí myslet...",deepl:"Síla vůle v něm MUSÍ udělat nějakou díru do jejich nedůvěry. Nějaká jejich část si musí myslet...",lindat:"Čirá síla vůle v něm MUSÍ udělat nějakou díru v jejich nedůvěře. Nějaká jejich část si musí myslet...",google:"Čistá síla vůle v něm MUSÍ dělat nějakou díru v jejich nedůvěřivosti. Nějaká část z nich si musí myslet..."},{id:"Dialogue Text/0x0100007000004CCB",source:'"Perhaps this is a sign that you should get back to solving your own murder, eh, detective?"',target:'"Možná je to znamení, že byste se měl vrátit k řešení své vlastní vraždy, co, detektive?"',deepl:'"Možná je to znamení, že byste se měl vrátit k řešení své vlastní vraždy, co, detektive?"',lindat:'"Možná je to znamení, že byste se měl vrátit k řešení vlastní vraždy, že, detektive?"',google:'"Možná je to znamení, že byste se měl vrátit k vyřešení vlastní vraždy, co, detektive?"'},{id:"Dialogue Text/0x0100008100003150",source:'"No. Thank you. I got it." She gets the umbrella to open, and, with a quick smile and nod to the surgeon, sprints down the steps. The rain falls all around her...',target:'Ne. Děkuji. Mám to." Podaří se jí otevřít deštník, s krátkým úsměvem pokývne na chirurga a rozběhne se ze schodů. Kolem ní padá déšť...',deepl:'"Ne. Děkuji. Chápu." Deštník se jí otevře a s rychlým úsměvem a kývnutím na chirurga seběhne po schodech dolů. Všude kolem ní se snáší déšť...',lindat:'"Ne. Děkuju. Zvládnu to." Rozepne deštník a s rychlým úsměvem a kývnutím na chirurga seběhne ze schodů. Všude kolem ní padá déšť...',google:'"Ne. Děkuji. Mám to." Nechá otevřít deštník as rychlým úsměvem a kývnutím na chirurga sprintuje po schodech dolů. Všude kolem ní padá déšť...'},{id:"Conversation/2hhisinsfuqmo2cl/Title",source:"Arx - EasterEggs / Flow – The Arctic Swimmer",target:"Arx - EasterEggs / Flow – The Arctic Swimmer",deepl:"Arx - EasterEggs / Flow - Arktický plavec",lindat:"Arx – EasterEggs / Flow – Arktický plavec",google:"Arx - EasterEggs / Flow - Polární plavec"},{id:"Dialogue Text/0x0100000600018004",source:`"Here's the kicker -- this designer, this *lead designer* of a world famous design studio -- was *born* in Martinaise. A local boy. Martin Martinaise."`,target:'"A tady je ten zvrat - ten designér, ten *hlavní designér* světoznámého studia - se narodil v Martinéze. Místní hoch. Martin Martinéza."',deepl:'"A teď to hlavní - tento designér, tento *vedoucí designér* světoznámého designérského studia, se *narodil* v Martinaise. Místní kluk. Martin Martinaise."',lindat:'"V tom je háček -- tenhle designér, tenhle *hlavní designér* světově proslulého designérského studia -- se *narodil* v Martinaise. Místní kluk. Martin Martinaise."',google:'"Tady je kicker - tento návrhář, tento *vedoucí designér* světoznámého designového studia -- se *narodil* v Martinaise. Místní chlapec. Martin Martinaise."'},{id:"Dialogue Text/0x0100002100002B86",source:"Like he's ready to lay out a fine theory, crafted together like a puzzle box.",target:"Jako by byl připraven vyložit nějakou pěknou teorii, poskládanou dohromady jako skládačka.",deepl:"Jako by byl připraven vyložit jemnou teorii, poskládanou dohromady jako skládačka.",lindat:"Jako by byl připraven vyložit jemnou teorii, sestavenou dohromady jako puzzle box.",google:"Jako by byl připraven sestavit skvělou teorii, vytvořenou dohromady jako puzzle box."},{id:"Dialogue Text/0x0100000500003455",source:"And then -- sleep doesn't come.",target:"A pak - spánek nepřichází.",deepl:"A pak - spánek nepřichází.",lindat:"A pak – spánek nepřichází.",google:"A pak -- spánek nepřichází."},{id:"Dialogue Text/0x0100000F00014867",source:"Focus on the negative space -- this will tell you the parameters of each letter. Isolate each one and *decipher*.",target:"Zaměř se na negativní prostor - ten ti ukáže parametry jednotlivých písmen. Každé z nich izoluj a *rozlušti*.",deepl:"Zaměřte se na negativní prostor - ten vám ukáže parametry jednotlivých písmen. Každé z nich izolujte a *rozluštěte*.",lindat:"Zaměřte se na záporný prostor -- ten vám řekne parametry každého písmene. Izolujte každé z nich a *rozluštíte*.",google:"Zaměřte se na negativní prostor - to vám řekne parametry každého písmene. Izolujte každou z nich a *dešifrujte*."},{id:"Dialogue Text/0x0100005A0000D606",source:'"Other than squeezing every drop out of us."',target:'"Kromě toho obrat nás i o kalhoty."',deepl:'"Kromě toho, že z nás vyždímá každou kapku."',lindat:'"Kromě toho, že z nás vymáčknou každou kapku."',google:'"Jinak než z nás vymačkat každou kapku."'},{id:"Dialogue Text/0x010000570000B626",source:'"No, amber sounds too boring."',target:'"Ne, jantar zní příliš nudně."',deepl:'"Ne, jantar zní příliš nudně."',lindat:'"Ne, jantar zní příliš nudně."',google:'"Ne, jantar zní příliš nudně."'},{id:"Dialogue Text/0x0100007800008147",source:"It's really there. Spinning slowly -- in absolute silence -- its limbs long and slender.",target:"Opravdu tam je. Pomalu se točí – v naprostém tichu – má dlouhé a hubené končetiny.",deepl:"Opravdu tam je. Pomalu se otáčí - v naprostém tichu - jeho končetiny jsou dlouhé a štíhlé.",lindat:"Opravdu tam je. Pomalu se otáčí – v absolutním tichu – dlouhé a štíhlé končetiny.",google:"Opravdu tam je. Pomalu se točí – v naprostém tichu – má dlouhé a štíhlé končetiny."},{id:"Dialogue Text/0x010000070000F887",source:'"They should have chosen a place away from people and buildings."',target:'"Měli si vybrat místo daleko od lidí a budov."',deepl:'"Měli si vybrat místo daleko od lidí a budov."',lindat:'"Měli si vybrat místo daleko od lidí a budov."',google:'"Měli si vybrat místo daleko od lidí a budov."'},{id:"Dialogue Text/0x0100000600019547",source:"Fine, then. I give up on Raphaël...",target:"Dobře tedy. Vzdávám se Raphaëla...",deepl:"Dobře tedy. Vzdávám se Raphaëla...",lindat:"Tak dobře. S Raphaelem to vzdávám...",google:"Dobře pak. Vzdávám se Raphaëla..."},{id:"Dialogue Text/0x0100000B0000277F",source:"The lock turns easily. You hear a click as the shackle pops open.",target:"Zámek se snadno otáčí. Když se otevře, ozve se cvaknutí.",deepl:"Zámek se snadno otáčí. Když se zámek otevře, ozve se cvaknutí.",lindat:"Zámek se otočí snadno. Uslyšíte cvaknutí, jak se okov rozevře.",google:"Zámek se snadno otáčí. Slyšíte cvaknutí, jak se poutko otevírá."},{id:"Dialogue Text/0x010000820001D949",source:`"Until you *have* something on her. She said she's heard of you from Jamrock. That you're a human can-opener. That you play suspects against each other. Open them up, like cans."`,target:'"Dokud na ni něco nebudeš mít. Říkala, že o tobě slyšela ze Šprajclu. Že seš louskáček na lidi. Že manipuluješ podezřelý proti sobě. Louskáš je je jako ořechy."',deepl:'"Dokud na ni něco nemáš. Říkala, že o tobě slyšela od Jamrocka. Že jsi lidský otvírák. Že hraješ podezřelé proti sobě. Otevíráš je jako konzervy."',lindat:'"Dokud na ni něco nemáte. Říkala, že o vás slyšela z Jamrocku. Že jste lidský otvírač konzerv. Že proti sobě hrajete podezřelé. Otevřete je, jako konzervy."',google:'"Dokud na ní něco *nebudete mít*. Řekla, že o vás slyšela od Jamrocku. Že jste lidský otvírák na konzervy. Že proti sobě hrajete podezřelé. Otevřete je jako plechovky."'},{id:"Dialogue Text/0x01000070000043B3",source:'"*Nein*, Tyrbald!" the Man from Hjelmdall bellows over the army of flesh and bone. "Have courage! For the Northlands... for HJELMDALL!!!" He leaps to the mezzanine to face the black-eyed figure and like a mad ice bear whirling twin *zweihänders* -- *Sturm* and *Drang* -- he ploughs through the ranks of the deathless, surrounding the necromancer...',target:'"*Nein*, Tyrbalde!" zařve muž z Hjelmdallu nad armádou z masa a kostí. "Měj odvahu! Za Severní země... za HJELMDALL!!!" Vyskočí na mezipatro, aby se postavil černooké postavě a jako rozzuřený lední medvěd vířící dvěma dvouručáky - *Sturmem* a *Drangem* - se prodírá řadami nemrtvých, které obklopují nekromanta...',deepl:'"*Nein*, Tyrbalde!" zařve Muž z Hjelmdallu nad armádou z masa a kostí. "Mějte odvahu! Za Severní země... za HJELMDALL!!!" Vyskočí na mezipatro, aby se postavil černooké postavě, a jako rozzuřený lední medvěd vířící dvojitými *zweihändery* - *Sturmem* a *Drangem* - se prodere řadami nesmrtelných a obklíčí nekromanta...',lindat:'"*Nein*, Tyrbalde!" řve Muž z Hjelmdallu nad armádou z masa a kostí. "Mějte odvahu! Za Severní země... za HJELMDALLA!!!" Vyskočí do mezipatra, aby čelil postavě s černýma očima a jako šílený ledový medvěd vířící dvojče *zweihänders* -- *Sturm* a *Drang* – prokousává se řadami nesmrtelných, obklopuje nekromanta...',google:'"*Nein*, Tyrbalde!" muž z Hjelmdallu ječí nad armádou z masa a kostí. "Měj odvahu! Za Northlands... za HJELMDALL!!!" Skočí do mezipatra, aby čelil černooké postavě a jako šílený ledový medvěd rotující dvojče *zweihänders* -- *Sturm* a *Drang* -- se prodírá řadami nesmrtelných a obklopuje nekromanta...'},{id:"Dialogue Text/0x0100004C00000F5A",source:"The radio falls silent and lifeless. The communications officer has disconnected the call.",target:"Rádio zmlkne. Komunikační důstojník ukončil hovor.",deepl:"Rádio ztichne a ztratí se v něm život. Komunikační důstojník hovor přerušil.",lindat:"Rádio ztichne a je bez života. Komunikační důstojník odpojil hovor.",google:"Rádio ztichne a je bez života. Komunikační důstojník přerušil hovor."},{id:"Dialogue Text/0x010000570001DE9C",source:"Take the speed from the table.",target:"Vezmi speed ze stolku.",deepl:"Vezměte si z tabulky rychlost.",lindat:"Vezměte rychlost od stolu.",google:"Vezměte rychlost ze stolu."},{id:"Dialogue Text/0x0100002F00012905",source:"He draws shallow breaths.",target:"Mělce se nadechuje.",deepl:"Mělce se nadechne.",lindat:"Zhluboka se nadechuje.",google:"Málo dýchá."},{id:"Dialogue Text/0x0100004500000AE8",source:`"No-no, think about it! One where they plunge into a torrid spiral of pain and recrimination. Only it's *really long* and drawn out. Scarred for life. Phantom limb!"`,target:'"Ne-ne, zapřemýšlej o tom! Takový ten, kde se ponoří do mučivé spirály bolesti a obviňování. Jenže je to *opravdu dlouhé* a protahované. Zjizveni na celý život. Fantomová bolest!"',deepl:'"Ne-ne, přemýšlej o tom! Takový, kde se ponoří do mučivé spirály bolesti a obviňování. Jenže je to *opravdu dlouhé* a protahované. Zjizvená na celý život. Přízračná končetina!"',lindat:"„Ne – ne, přemýšlej o tom! O takovém, kde se ponoří do žhavé spirály bolesti a vzájemného obviňování. Jenomže je to *opravdu dlouhé* a protahované. Zjizvené na celý život. Fantomová končetina!“",google:'"Ne-ne, přemýšlej o tom! Takovou, kde se ponoří do prudké spirály bolesti a obviňování. Jenomže je *skutečně dlouhá* a natahovaná. Zjizvená na celý život. Fantomová končetina!"'},{id:"Dialogue Text/0x010000580000ADEF",source:`"No, and I doubt they'll get back to me before tomorrow morning. Anything else?"`,target:'"Ne a pochybuji, že se na mě dostane před zítřjším ránem. Ještě něco?"',deepl:'"Ne, a pochybuji, že se mi ozvou dřív než zítra ráno. Ještě něco?"',lindat:'"Ne, a pochybuji, že se mi ozvou dřív než zítra ráno. Ještě něco?"',google:'"Ne a pochybuji, že se mi ozvou dříve než zítra ráno. Ještě něco?"'},{id:"Dialogue Text/0x0100005700015D96",source:`"It's one day going to be a *candidate member* of EPIS, sure."`,target:'"Jednoho dne bude *kandidujícím členem* EPISu, jistě."',deepl:'"Jednoho dne se stane *kandidátem* na člena EPIS, jistě."',lindat:'"Jednoho dne to bude *kandidátský člen* EPIS, jasně."',google:'"Jednoho dne bude *kandidát na člena* EPIS, jistě."'},{id:"Alternate1/0x010000450001C9C8",source:'"No time to rest now." [Leave.]',target:'"Na odpočinek teď není čas." [Odejdi.]',deepl:'"Teď není čas na odpočinek." [Odejít.]',lindat:'"Teď není čas na odpočinek." [Odejděte]',google:'"Teď není čas na odpočinek." [Odejít.]'},{id:"Dialogue Text/0x010000580000EBB6",source:'"Klaasje... said you knew something was wrong immediately."',target:'"Klaasje... říkala, že jste hned poznala, že je něco špatně."',deepl:'"Klaasje... říkala, že jsi okamžitě poznal, že něco není v pořádku."',lindat:'"Klaasje... říkal, že hned víš, že něco není v pořádku."',google:'"Klaasje... řekl, že jsi okamžitě věděl, že je něco špatně."'},{id:"Conversation/0x0100005A00012F17/Description",source:"Medicinal Purposes of the Pale.",target:"Léčivé účinky bledomezi.",deepl:"Léčebné účely bledulí.",lindat:"Léčebné účely pale.",google:"Medicinal Purposes of the Pale."},{id:"Dialogue Text/0x0100008100003A4E",source:"You should eat it slowly, really savour the chef's concept.",target:"Měl bys ho jíst pomalu a opravdu si vychutnat šéfkuchařův koncept.",deepl:"Měli byste ho jíst pomalu a opravdu si vychutnat šéfkuchařův koncept.",lindat:"Měli byste jíst pomalu, opravdu vychutnat kuchař koncept.",google:"Měli byste to jíst pomalu, opravdu si vychutnejte koncept šéfkuchaře."},{id:"Actors/0x0100008200008E08/Name",source:"Cuno's Dad",target:"Kunův táta",deepl:"Cunoův otec",lindat:"Cunův táta",google:"Cunoův táta"},{id:"Dialogue Text/0x0100000700019DD2",source:'"We need some *real* music in here."',target:'"Potřebujeme tady nějakou *skutečnou* hudbu."',deepl:'"Potřebujeme tady nějakou *skutečnou* hudbu."',lindat:'"Potřebujeme tu *opravdovou* muziku."',google:'"Potřebujeme tady nějakou *skutečnou* hudbu."'},{id:"Dialogue Text/0x010000450000EC41",source:"The young woman looks at the may bell in your hand -- just a glance -- then takes a drag of her cigarette.",target:"Mladá žena se podívá na konvalinky ve tvé ruce - jen letmo - a pak potáhne z cigarety.",deepl:"Mladá žena se podívá na zvonek s májem ve vaší ruce - jen letmo - a pak potáhne z cigarety.",lindat:"Mladá žena se podívá na májový zvonek ve vaší ruce – stačí letmý pohled – a pak potáhne z cigarety.",google:"Mladá žena se podívá na májový zvonek ve vaší ruce – jen letmý pohled – a pak si potáhne z cigarety."},{id:"Dialogue Text/0x0100004500004C48",source:`"You are," he says with calm certainty. "This pig is Cuno's."`,target:'"To jsi," řekne s klidnou jistotou. "Tohle prase je Kunovo."',deepl:'"Jsi," řekne s klidnou jistotou. "Tohle prase je Cuno."',lindat:"„To jsi,“ řekne s klidnou jistotou. „To prase je Cunovo.“",google:'"Jsi," říká s klidnou jistotou. "To prase je Cunovo."'},{id:"Dialogue Text/wf2l46hqj189iokx",source:"Indeed. Think of them as balls.",target:"Coby. Mysli na ně jako na kuličky.",deepl:"Vskutku. Představte si je jako koule.",lindat:"Vskutku. Berte je jako koule.",google:"Vskutku. Představte si je jako koule."},{id:"Dialogue Text/0x0100000F00009717",source:"“He’s studying macro- *and* micro-economics.”",target:'"Studuje makroekonomii *i* mikroekonomii."',deepl:'"Studuje makroekonomii i mikroekonomii."',lindat:"„Studuje makro- *a* mikroekonomii.“",google:'"Studuje makro * a * mikroekonomii."'},{id:"Dialogue Text/0x0100004500012833",source:"Like hell you would have -- remember?",target:"To byste sakra musel - pamatujete?",deepl:"To bys sakra musel - pamatuješ?",lindat:"K čertu s tebou – pamatuješ?",google:"Jako sakra bys měl -- pamatuješ?"},{id:"Dialogue Text/0x010000040000B3F2",source:"Say nothing.",target:"Neříkej nic.",deepl:"Nic neříkejte.",lindat:"Nic neříkej.",google:"Nic neříkej."},{id:"Dialogue Text/0x010000040000FE27",source:`"Cuno's sorry too. Cuno feels sorry for the binoclard."`,target:'"Kunovi je to taky líto. Kuno lituje brejlotardy."',deepl:'"Cuno se také omlouvá. Cuno lituje binoklara."',lindat:"„Cuna to taky mrzí. Cuna ten binokulár mrzí.“",google:'"Cuno je taky líto. Cuno lituje dalekohled."'},{id:"Items/money/Description",source:"Fiscal resources in the amount of...",target:"Fiskální zdroje ve výši...",deepl:"Fiskální zdroje ve výši...",lindat:"Fiskální zdroje ve výši...",google:"Fiskální zdroje ve výši..."},{id:"Dialogue Text/0x0100002B000040F4",source:`"No, no!" Her eyes widen at your misunderstanding. "He is definitely not a cop. I meant that he's a little chubby, that's all."`,target:'"Ne, ne!" Její oči se široce otevřou nad tvým neporozuměním. "Určitě není polda. Myslela jsem tím, že je trochu naducaný, toť vše."',deepl:'"Ne, ne!" Její oči se rozšíří nad tvým nepochopením. "On rozhodně není policajt. Chtěla jsem říct, že je trochu baculatý, to je všechno."',lindat:"„Ne, ne!“ Vykulila oči nad tvým nedorozuměním. „Rozhodně to není policajt. Myslela jsem tím, že je trochu baculatý, to je všechno.“",google:'"Ne, ne!" Její oči se rozšířily tvým nedorozuměním. "Rozhodně to není policajt. Myslel jsem, že je trochu baculatý, to je vše."'}],r=[{id:"Dialogue Text/0x0100004500015AD0",source:'"Can you tell us precisely what these mean?" (Hand her the photo.)',target:'"Můžete nám přesně říct, co to znamená?" (Podej jí fotografii.)',deepl:'"Můžete nám přesně říct, co to znamená?" (Podejte jí fotografii.)',lindat:'"Můžete nám říct, co přesně znamenají?" (Podejte jí tu fotku.)',google:'"Můžeš nám říct, co přesně znamenají?" (Podejte jí fotku.)'},{id:"Items/glasses_flipup/Description",source:"These flip-up sunglasses were fashionable in the Old, but have since lost their popularity. Their thin gold-alloy wire frames are a reminder of drug-addled bohemian artists. These days the glasses are only favoured by organized crime accountants who desire to look cool.",target:"Za starých časů byly tyto sluneční brýle módní, ale od té doby ztratily na popularitě. Jejich tenké drátěné obroučky ze zlaté slitiny jsou vzpomínkou na bohémské umělce závislé na drogách. V dnešní době si brýle oblíbili pouze účetní organizovaného zločinu, kteří touží vypadat hustě.",deepl:"Ve starých dobách byly tyto sluneční brýle módní, ale od té doby ztratily na popularitě. Jejich tenké drátěné obroučky ze zlaté slitiny jsou vzpomínkou na bohémské umělce závislé na drogách. V dnešní době si brýle oblíbili pouze účetní organizovaného zločinu, kteří touží vypadat cool.",lindat:"Tyto flip-up sluneční brýle byly ve Starém módní, ale od té doby ztratily svou popularitu. Jejich tenké drátěné obroučky ze zlaté slitiny jsou připomínkou drogou omámených bohémských umělců. V dnešní době brýle zvýhodňují pouze účetní organizovaného zločinu, kteří touží vypadat cool.",google:"Tyto vyklápěcí sluneční brýle byly ve starověku módní, ale od té doby ztratily svou popularitu. Jejich tenké drátěné rámy ze zlaté slitiny jsou připomínkou drogově závislých bohémských umělců. V dnešní době brýle preferují pouze účetní z organizovaného zločinu, kteří chtějí vypadat cool."},{id:"Dialogue Text/0x0100005A00008831",source:'"You should talk to Noid about that. I just got a distinct *burnout* and *dopehead* sine from them. Probably jacked up to some snuff station too. Probably, very likely."',target:'"O tom by sis měl promluvit s Noidem. Na mě působili jako jasný *trosky* a *feťáci*. Nejspíš jsou i napíchlí na nějakou snuff stanici."',deepl:'"Měl by sis o tom promluvit s Noidem. Právě jsem od nich dostal zřetelnou *vyhořelou* a *dopeheadskou* sinusoidu. Nejspíš je taky napojenej na nějakou snuff stanici. Pravděpodobně, velmi pravděpodobně."',lindat:"„O tom by sis měl promluvit s Noidem. Právě jsem od nich dostal zřetelný *burnout* a *feťácký* sine. Nejspíš taky napíchnutý na nějakou šňupací stanici. Pravděpodobně, velmi pravděpodobně.“",google:'"Měl byste si o tom promluvit s Noidem. Právě jsem od nich dostal zřetelné *vyhoření* a *dopehead* sinus. Pravděpodobně jsem se také připojil k nějaké šňupací stanici. Pravděpodobně, velmi pravděpodobně."'},{id:"Conversation/0x0100006B000006B1/Description",source:"Barks for WR protester post-mercenary tribunal. The Women's Rights protester is drunk, lying in the sand. He uses the tare drunk/working class drunk idle animation.",target:"Štěká na protestující WR po žoldnéřském tribunálu. Protestující za práva žen je opilý a válí se v písku. Používá tárovou animaci opilý/pracující třída opilá nečinně..",deepl:"Štěká na protestující WR po žoldnéřském tribunálu. Protestující za práva žen je opilý a válí se v písku. Používá tárovou animaci opilý/pracující třída opilá nečinně.",lindat:"Štěkání za protestující WR post-žoldácký tribunál. Protestující za práva žen je opilý, leží v písku. Používá tárovou opileckou/dělnickou třídu opileckou nečinnou animaci.",google:"Štěká pro post-žoldnéřský tribunál demonstrantů WR. Protestující za práva žen je opilá a leží v písku. Používá animaci tára opilý/dělnická třída opilý nečinný."},{id:"Dialogue Text/0x010000060001E639",source:"Oh god...",target:"Bože...",deepl:"Bože...",lindat:"Bože...",google:"Pane Bože..."},{id:"Conversation/0x0100002F00008F63/Description",source:"Third of Measurehead's awesomely hot companions who also maybe barks mocking stuff at you (on clicking). Or might not, if she's the one sitting behind Measurehead, out of your reach.",target:"Třetí z Hlavoměrových úžasně sexy společnic, která na tebe možná také posměšně pokřikuje (při kliknutí). Nebo taky ne, pokud sedí za Óbrhlavou, mimo tvůj dosah.",deepl:"Třetí z Measureheadových úžasně sexy společníků, který na vás možná také posměšně štěká (při kliknutí). Nebo taky ne, pokud sedí za Measureheadem, mimo tvůj dosah.",lindat:"Třetí z Measureheadových úžasně sexy společnic, která na vás taky možná posměšně štěká (při kliknutí). Nebo taky nemusí, pokud to je ta, co sedí za Measureheadem, mimo váš dosah.",google:"Třetí z úžasně žhavých společníků Measurehead, kteří na vás také možná posměšně štěkají (po kliknutí). Nebo možná ne, pokud je to ona, kdo sedí za Measurehead, mimo váš dosah."},{id:"Dialogue Text/0x0100004D00002DDB",source:"His courtesy is not insincere, but he prefers being alone with his projector, just watching the movement of light across the walls of the shop.",target:"Jeho zdvořilost není neupřímná, ale raději je se svým projektorem sám a jen pozoruje pohyb světla po stěnách obchodu.",deepl:"Jeho zdvořilost není neupřímná, ale raději je se svým projektorem sám a jen pozoruje pohyb světla po stěnách obchodu.",lindat:"Jeho zdvořilost není neupřímná, ale raději je sám se svým projektorem a jen pozoruje pohyb světla po stěnách obchodu.",google:"Jeho zdvořilost není neupřímná, ale raději je sám se svým projektorem a jen sleduje pohyb světla po stěnách obchodu."},{id:"Dialogue Text/0x0100004500001E1D",source:"Written in a rush. In pain. A race to beat your own heart's pulse to some dark finish line.",target:"Psáno ve spěchu. V bolestech. Závod o zdolání vlastního srdečního tepu až do jakési temné cílové rovinky.",deepl:"Psáno ve spěchu. V bolestech. Závod o tep vlastního srdce až k nějaké temné cílové čáře.",lindat:"Napsáno ve spěchu. V bolestech. Závod o tep vlastního srdce k nějaké temné cílové čáře.",google:"Psáno ve spěchu. V bolestech. Závod o zrychlení tepu vlastního srdce až k nějaké temné cílové čáře."},{id:"Dialogue Text/0x01000006000151CE",source:"You could ask the Miss what she thinks. Later, if you have the time -- though you doubt she'll tell you much at this point.",target:"Můžeš se zeptat slečny, co si o tom myslí. Později, pokud budeš mít čas - i když pochybuješ, že ti toho teď řekne víc.",deepl:"Můžete se zeptat slečny, co si o tom myslí. Později, pokud budeš mít čas - i když pochybuješ, že ti toho teď řekne víc.",lindat:"Můžete se zeptat slečny, co si myslí. Později, pokud budete mít čas – i když pochybujete, že by vám toho v této chvíli moc řekla.",google:"Můžete se zeptat slečny, co si myslí. Později, pokud budete mít čas - i když pochybujete, že vám toho v tuto chvíli řekne hodně."},{id:"Dialogue Text/0x0100006B0000A7CB",source:`"Yeah, man. It's like... at death's door. No wonder you know nothing about the future. You won't *be* there."`,target:'"Jo, chlape. Je to jako... bejt na prahu smrti. Žádnej div, že nevíš nic o budoucnosti. Ty v ní nemáš místo.',deepl:'"Jo, chlape. Je to jako... na prahu smrti. Není divu, že nevíš nic o budoucnosti. Nebudeš tam."',lindat:'"Jo, člověče. Je to jako... na prahu smrti. Není divu, že nevíš nic o budoucnosti. Tam už *nebudeš.."',google:'"Jo, člověče. Je to jako... u dveří smrti. Není divu, že nevíš nic o budoucnosti. *Nebudeš* tam."'},{id:"Dialogue Text/0x0100006B000095DC",source:"Yes! We demand she be punished for deceiving us. We demand her anxiety. We demand her fear.",target:"Ano! Žádáme, aby byla potrestána za to, že nás podvedla. Požadujeme, aby se bála. Požadujeme její strach.",deepl:"Ano! Žádáme, aby byla potrestána za to, že nás podvedla. Požadujeme, aby se bála. Požadujeme její strach.",lindat:"Ano! Požadujeme, aby byla potrestána za to, že nás podvedla. Požadujeme její úzkost. Požadujeme její strach.",google:"Ano! Žádáme, aby byla potrestána za to, že nás oklamala. Požadujeme její úzkost. Požadujeme její strach."},{id:"Dialogue Text/0x0100007500001330",source:"Loos, Radio City? That's the same book the working class woman was reading at the bookstand...",target:"Loos, město rádií? To je ta samá kniha, kterou si četla dělnická žena u knihkupectví.",deepl:"Loos, Radio City? To je ta samá kniha, kterou četla dělnice u knihkupectví...",lindat:"Loos, Radio City? To je ta samá kniha, kterou četla ta dělnice u knihkupectví...",google:"Loosi, Radio City? To je stejná kniha, kterou četla žena z dělnické třídy u stánku..."},{id:"Conversation/0x0100002F0000F841/Description",source:"your old posse. formerly near FELD electrics building with his kid",target:"tvoje stará parta. dříve poblíž budovy FELD Electrics s jeho dítětem",deepl:"vaše stará parta. dříve poblíž budovy FELD Electrics s jeho dítětem",lindat:"vaše stará parta. dříve poblíž budovy FELD electrics se svým děckem",google:"vaše stará družina. dříve se svým dítětem poblíž budovy elektrotechniky FELD"},{id:"Dialogue Text/0x0100000700008D72",source:"Sounds like the kid has a soft spot for Lilienne.",target:"Zdá se, že tohle dítě má slabost pro Lilianu.",deepl:"Zdá se, že ten kluk má pro Lilienne slabost.",lindat:"Vypadá to, že ten kluk má pro Lilienne slabost.",google:"Vypadá to, že to dítě má pro Lilienne slabost."},{id:"Dialogue Text/0x010000040000FDC5",source:`"He's gonna fucking mi..."`,target:'"On to kurva ne..."',deepl:'"On mi kurva..."',lindat:'"On mi kurva..."',google:'"On mě posere..."'},{id:"Dialogue Text/0x0100000F0000ECA7",source:'"Nothing, just lost my balance a moment."',target:'"Nic, jen jsem na chvíli ztratil sebekontrolu."',deepl:'"Nic, jen jsem na chvíli ztratil rovnováhu."',lindat:'"Nic, jen jsem na chvíli ztratil rovnováhu."',google:'"Nic, jen jsem na chvíli ztratil rovnováhu."'},{id:"Dialogue Text/0x0100007100004099",source:`"What will happen once you drink from this 'perforation'?"`,target:`"Co se stane, až se napijete z toho 'proražení'?"`,deepl:`"Co se stane, až se napijete z této 'perforace'?"`,lindat:`"Co se stane, až se napijete z této 'perforace'?"`,google:`"Co se stane, až se napiješ z této 'perforace'?"`},{id:"Dialogue Text/0x0100000200001112",source:"Don't be fooled. The bad times have already begun.",target:"Nenech se oblbnout. Špatné časy už začaly.",deepl:"Nenechte se zmást. Špatné časy už začaly.",lindat:"Nenechte se zmást. Špatné časy už začaly.",google:"Nenechte se zmást. Zlé časy už začaly."},{id:"Dialogue Text/0x0100004C00000A73",source:`"10-4, what's your status? Over."`,target:'"10-4, jaký je váš stav? Přepínám."',deepl:'"10-4, jaký je váš stav? Konec."',lindat:'"10-4, jak jste na tom? Přepínám."',google:'"10-4, jaký je tvůj stav? Konec."'},{id:"Dialogue Text/0x010000070000FF9F",source:`"I don't really know. Further down the peninsula I guess. I mean that's where they were heading." She points north. "Who else are you looking for, beside Snow Men?"`,target:'"Já vlastně nevím. Hádám, že dál na poloostrově. Mám na mysli to, že tam mířili." Ukáže na sever. "Koho ještě hledáte, kromě Sněžných mužů?"',deepl:'"To opravdu nevím. Asi dál na poloostrově. Myslím, že tam měli namířeno." Ukáže na sever. "Koho ještě hledáš, kromě Sněžných mužů?"',lindat:"„To opravdu nevím. Myslím, že dál po poloostrově. Myslím tím, že tam měli namířeno.“ Ukáže na sever. „Koho ještě hledáte, kromě Sněhuláka?“",google:'"Opravdu nevím. Myslím, že dál na poloostrově. Chci říct, že tam mířili." Ukazuje na sever. "Koho jiného hledáš kromě Sněžných mužů?"'},{id:"Dialogue Text/0x0100008100004033",source:"Keep the thought to yourself.",target:"Nech si tu myšlenku pro sebe.",deepl:"Nechte si tuto myšlenku pro sebe.",lindat:"Myšlenku si nechte pro sebe.",google:"Nechte si myšlenku pro sebe."},{id:"Dialogue Text/0x0100000600019AF7",source:"Just nod compassionately.",target:"Jen soucitně přikývni.",deepl:"Jen soucitně přikývněte.",lindat:"Jen soucitně přikyvujte.",google:"Jen soucitně přikývněte."},{id:"Dialogue Text/0x010000640000B263",source:`"C'mere, you mesque coward... die with the rest... die like a man..."`,target:'"No tak, ty meskanskej zbabělče... zemři s ostatními... zemři jako chlap..."',deepl:'"No tak, ty zbabělče... zemři s ostatními... zemři jako chlap..."',lindat:'"Pojď sem, ty meskní zbabělče... zemři s ostatními... zemři jako muž..."',google:'"Pojď, ty zbabělče... zemři se zbytkem... zemři jako muž..."'},{id:"Dialogue Text/0x010000060000FA87",source:"Cool cop?",target:"Bezva polda?",deepl:"Bezva policajt?",lindat:"Pohodovej polda?",google:"Skvělý policajt?"},{id:"Dialogue Text/0x010000060001A90F",source:"Hmm... what does one talk about with a fellow officer?",target:"Hmm... o čem se mluví s kolegou policistou?",deepl:"Hmm... o čem se mluví s kolegou policistou?",lindat:"Hmm... o čem se mluví s kolegou důstojníkem?",google:"Hmm... o čem se mluví s kolegou důstojníkem?"},{id:"Dialogue Text/0x010000060001D91A",source:"Listen to him. For once.",target:"Poslechni ho. Pro jednou.",deepl:"Poslechněte si ho. Aspoň jednou.",lindat:"Poslechněte si ho. Aspoň jednou.",google:"Poslouchej ho. Výjimečně."},{id:"Dialogue Text/0x0100000900001E00",source:'"Come on, anyone would notice that!" She rolls her eyes.',target:'"No tak, toho by si všiml každý!" Obrátí oči v sloup.',deepl:'"No tak, toho by si všiml každý!" Obrátí oči v sloup.',lindat:"„No tak, toho by si všiml každý!“ Obrátí oči v sloup.",google:'"No tak, každý by si toho všiml!" Protočí očima.'},{id:"Dialogue Text/0x0100004500019BD6",source:'"Where the walls are still porous and you can slip through. This is just... something to get me through the night you know. A little *espérance*."',target:'"Tam, kde jsou stěny stále děravé a můžete jimi proklouznout. Tohle je jen... něco, co mi pomůže přečkat noc, víte? Trochu *espérance*."',deepl:'"Tam, kde jsou stěny stále děravé a můžete jimi proklouznout. Tohle je jen... něco, co mi pomůže přečkat noc, víš? Trochu *espérance*."',lindat:'"Kde jsou stěny ještě porézní a dá se jimi proklouznout. Tohle je jen... něco, co mi pomůže přečkat noc. Trochu *espérance*."',google:'"Tam, kde jsou stěny stále porézní a můžete jimi proklouznout. Tohle je jen... něco, co mě přenese přes noc, víte. Trochu *espérance*."'},{id:"Dialogue Text/0x010000060000F902",source:"No. It's not that.",target:"Ne. To není ono.",deepl:"Ne, tak to není.",lindat:"Ne. O to nejde.",google:"Ne. To není ono."},{id:"Dialogue Text/0x0100005300004B2C",source:`"In any case, I'll let you take it from here."`,target:'"Každopádně to nechám na vás."',deepl:'"Každopádně to nechám na vás."',lindat:'"V každém případě vás nechám, abyste se o to postaral sám."',google:'"V každém případě tě nechám vzít to odtud."'},{id:"Dialogue Text/0x0100006B00005615",source:"Don't stop nodding.",target:"Nepřestávej kývat.",deepl:"Nepřestávejte přikyvovat.",lindat:"Nepřestávej přikyvovat.",google:"Nepřestávejte přikyvovat."},{id:"Dialogue Text/0x0100009200001043",source:`"It doesn't matter what I say, you're just going to continue, right?"`,target:'"Nezáleží na tom, co říkám, budeš prostě pokračovat, že?"',deepl:'"Nezáleží na tom, co říkám, budeš prostě pokračovat, že?"',lindat:'"Nezáleží na tom, co řeknu, ty prostě budeš pokračovat, že?"',google:'"Nezáleží na tom, co říkám, budeš prostě pokračovat, ne?"'},{id:"Conversation/0x010000640000CA13/Description",source:"ESPRIT RED CHECK",target:"DUCH ČERVENÁ KONTROLA",deepl:"ESPRIT ČERVENÁ KONTROLA",lindat:"ESPRIT ČERVENÁ KONTROLA",google:"ESPRIT ČERVENÝ ŠEK"},{id:"Dialogue Text/0x010000040000E27C",source:`"No?" The lieutenant's expression is stern and impenetrable. He points at you: "You *will* get your shit together."`,target:'"Ne?" Poručík má přísný a neproniknutelný výraz. Ukáže na tebe: "Vy si ty svoje sračky dohromady *dáte*"',deepl:'"Ne?" Poručík má přísný a neproniknutelný výraz. Ukáže na tebe: "Dáš se dohromady."',lindat:"„Ne?“ Poručíkova tvář je přísná a neproniknutelná. Ukazuje na vás: „Ty se dáš do kupy.“",google:'"Ne?" Poručíkův výraz je přísný a neproniknutelný. Ukáže na tebe: "Ty *dáš* ty sračky dohromady."'},{id:"Dialogue Text/0x010000820000A23A",source:`"Everything points to the Dockworkers' Union: the tracks in the mud, the circumstances in Martinaise, my preliminary information..."`,target:'"Všechno ukazuje na Dokařské odbory: stopy v bahně, okolnosti v Martinéze, moje předběžné informace..."',deepl:'"Všechno ukazuje na Dělnickou unii: stopy v bahně, okolnosti v Martinaise, moje předběžné informace..."',lindat:'"Všechno ukazuje na Svaz dokařů: stopy v bahně, okolnosti v Martinaise, moje předběžné informace..."',google:'"Všechno ukazuje na Svaz přístavních dělníků: stopy v bahně, okolnosti v Martinaise, moje předběžné informace..."'},{id:"Dialogue Text/0x0100007000006B39",source:`"I won't tell you how to do your job. But remember, this is an RCM matter. Make sure you weigh your next words carefully."`,target:'"Nebudu vám říkat, jak máte dělat svoji práci. Ale pamatujte, toto je záležitost ROM. Zvažte svá další slova pečlivě."',deepl:'"Nebudu vám říkat, jak máte dělat svou práci. Ale pamatujte, že se jedná o záležitost RCM. Ujistěte se, že pečlivě zvážíte svá další slova."',lindat:'"Nebudu vám říkat, jak máte dělat svou práci. Ale pamatujte si, že tohle je záležitost RCM. Dbejte na to, abyste pečlivě vážil svá další slova."',google:'"Nebudu ti říkat, jak máš dělat svou práci. Ale pamatuj, že tohle je záležitost RCM. Ujistěte se, že pečlivě zvažte svá další slova."'},{id:"Dialogue Text/0x010000070000161B",source:'"Yes. Well. I looked at it and thought I should -- because it says *youth centre* and I have my own children. I am, of course, just a stupid poor person, so what do I know?"',target:'"Ano. No, podívala jsem se na to a řekla si, že bych měla - protože se tam píše o *centru pro mládež* a já mám vlastní děti. Jsem samozřejmě jen hloupá chudá osoba, takže co tak můžu vědět?"',deepl:'"Ano. Podívala jsem se na to a řekla jsem si, že bych měla - protože je tam napsáno *mládežnické centrum* a já mám vlastní děti. Jsem ovšem jenom hloupý chudák, tak co já vím?"',lindat:'"Ano. No. Podívala jsem se na to a napadlo mě, že bych měla – protože se tam píše *centrum pro mládež* a já mám vlastní děti. Já jsem samozřejmě jen hloupý chudý člověk, tak co já vím?"',google:'"Ano. No. Díval jsem se na to a řekl jsem si, že bych měl - protože je tam napsáno *centrum pro mládež* a já mám vlastní děti. Jsem samozřejmě jen hloupý chudák, tak co já vím?"'},{id:"Dialogue Text/0x0100008100004D73",source:`"Ah, fuck it. Let's have more cryptids."`,target:'"Ále, srát na to. Dáme si víc kryptidů."',deepl:'"Ah, kašlu na to. Dáme si víc kryptoidů."',lindat:'"Á, seru na to. Dáme si ještě kryptidy."',google:'"Aha, kurva. Pojďme mít více kryptidů."'},{id:"Dialogue Text/0x010000040000600C",source:'"Yes. It was very cool."',target:'"Ano. Bylo to moc suprácké."',deepl:'"Ano. Bylo to moc fajn."',lindat:'"Ano. Bylo to velmi chladné."',google:'"Ano. Bylo to velmi cool."'},{id:"Conversation/ov8pa82yo2rd7rk0/Title",source:"Arx - EasterEggs / Modus Mullen / Flow – MULLEN ORB / locational 13",target:"Arx - EasterEggs / Modus Mullen / Flow – MULLEN ORB / locational 13",deepl:"Arx - EasterEggs / Modus Mullen / Flow - MULLEN ORB / lokální 13",lindat:"Arx - EasterEggs / Modus Mullen / Flow – MULLEN ORB / location 13",google:"Arx - EasterEggs / Modus Mullen / Flow – MULLEN ORB / umístění 13"},{id:"Dialogue Text/0x01000045000118D4",source:'"Reporting crimes is confidential in Revachol, miss."',target:'"Nahlášení trestných činů je v Revacholu důvěrné, slečno."',deepl:'"Nahlášení trestných činů je v Revacholu důvěrné, slečno."',lindat:'"Hlášení zločinů je v Revacholu důvěrné, slečno."',google:'"Hlášení zločinů je v Revacholu důvěrné, slečno."'},{id:"Dialogue Text/0x010000040000E964",source:`"Stop obsessing about your sexuality officer, you're about to seriously compromise the coroner's case."`,target:'"Přestaňte se zabývat svou sexualitou, detektive, vážně tím ohrozíte soudní pitvu."',deepl:'"Přestaňte se zabývat svou sexualitou, důstojníku, vážně tím ohrozíte koronerův případ."',lindat:'"Přestaňte být posedlý svou sexuologickou pracovnicí, chystáte se vážně kompromitovat koronerův případ."',google:'"Přestaňte být posedlí svým sexuálním důstojníkem, chystáte se vážně kompromitovat případ koronera."'},{id:"Dialogue Text/0x010000060001E445",source:"All right. Let's consider the context and meaning here.",target:"Dobře. Uvažujme o kontextu a významu.",deepl:"Dobře. Zvažme kontext a význam.",lindat:"Dobře. Pojďme se zamyslet nad kontextem a významem.",google:"Dobře. Podívejme se zde na kontext a význam."},{id:"Dialogue Text/0x01000072000035F8",source:'"But you said I have a vast soul and you will always come back to it."',target:'"Ale ty jsi řekla, že mám rozhlehlo duší a ty se k ní budeš vždy vracet."',deepl:'"Ale říkal jsi, že mám obrovskou duši a že se k ní vždycky vrátíš."',lindat:'"Ale vždyť jsi říkal, že mám obrovskou duši a ty se k ní vždycky vrátíš."',google:'"Ale řekl jsi, že mám obrovskou duši a vždy se k ní vrátíš."'},{id:"Dialogue Text/0x010000450000B9C5",source:"From the looks of it the Fifties haven't been much better for the Zone of Control -- you can see it in her eyes. Days slipping away....",target:"Jak to tak vypadá, padesátá léta nebyla pro Zónu kontroly o moc lepší - je jí to vidět na očích. Dny ubíhají....",deepl:"Jak to tak vypadá, padesátá léta nebyla pro Zónu kontroly o moc lepší - je jí to vidět na očích. Dny ubíhají....",lindat:"Podle toho, jak to vypadá, padesátá léta nebyla pro Zónu kontroly o moc lepší – je jí to vidět na očích. Dny utíkají...",google:"Jak to vypadá, padesátá léta nebyla pro Zónu kontroly o moc lepší – můžete to vidět v jejích očích. Dny utíkají...."},{id:"Dialogue Text/0x0100000800001304",source:`"I'll keep my Armistice handy, detective."`,target:'"Budu mít po ruce Příměří, detektive."',deepl:'"Budu mít po ruce Armistice, detektive."',lindat:'"Nechám si své příměří po ruce, detektive."',google:'"Budu mít své příměří po ruce, detektive."'},{id:"Dialogue Text/0x01000027000010EF",source:'"What are you doing?" he asks without turning his eyes from the street outside.',target:'"Co to provádíte?" zeptá se, aniž by odvrátil pohled od ulice.',deepl:'"Co to děláš?" zeptá se, aniž by odvrátil pohled od ulice.',lindat:'"Co to děláš?" ptá se, aniž by odvrátil oči od ulice venku.',google:'"Co děláš?" ptá se, aniž by otočil oči z ulice venku.'},{id:"Dialogue Text/0x0100005300003EF5",source:`"Now you'll excuse me. I have to get back to my own work."`,target:'Teď mě omluvte. Musím se vrátit ke své práci."',deepl:'"Teď mě omluvte. Musím se vrátit ke své práci."',lindat:'"Teď mě omluvte. Musím se vrátit ke své práci."',google:'"Teď mě omluvte. Musím se vrátit ke své práci."'},{id:"Items/magnesium/Description",source:"Magnesium is the salve upon the wretched torn up by the storm of life. NOTE! Magnesium is a MEDICINE. It will restore your Morale by +1. Click on the + icon to heal your Morale, if you have Morale damage.",target:"Hořčík je balzámem pro nešťastníky zmítané bouří života. POZNÁMKA: Hořčík je LÉK. Obnoví tvou morálku o +1. Kliknutím na ikonu + si vyléčíš Morálku, pokud ji máš poškozenou.",deepl:"Hořčík je balzámem na nešťastníky zmítané bouří života. POZNÁMKA: Hořčík je LÉK. Obnoví vaši morálku o +1. Kliknutím na ikonu + si vyléčíte Morálku, pokud máte poškozenou Morálku.",lindat:"Hořčík je hojivá mast na ubožáky rozervané bouří života. POZNÁMKA! Hořčík je LÉČIVÝ. Obnoví vaši morálku o +1. Klikněte na ikonu + a uzdravte svou morálku, máte-li morálku poškozenou.",google:"Hořčík je mastí na ubohé zmítané bouří života. POZNÁMKA! Hořčík je LÉK. Obnoví vaši morálku o +1. Kliknutím na ikonu + vyléčíte svou morálku, pokud máte poškození morálky."},{id:"Dialogue Text/0x010000060001A137",source:"This is tangential at best, but the lieutenant's *detective instinct* is still active.",target:"Je to přinejlepším nepodstatné, ale poručíkův *detektivní instinkt* je stále aktivní.",deepl:"Je to přinejlepším styčné, ale poručíkův *detektivní instinkt* je stále aktivní.",lindat:"To je přinejlepším tangenciální, ale poručíkův *detektivní instinkt* je stále aktivní.",google:"To je přinejlepším tangenciální, ale poručíkův *detektivní instinkt* je stále aktivní."}],d=[{id:"Dialogue Text/0x0100000700005B87",source:`"Yes..." He reluctantly nods. "It's probably the smart choice."`,target:'"Ano..." Neochotně přikývne. "Asi je to rozumná volba."',deepl:'"Ano..." Neochotně přikývne. "Asi je to rozumná volba."',lindat:'"Ano..." Neochotně přikývne. "Asi je to chytrá volba."',google:'"Ano..." Neochotně přikývne. "Pravděpodobně je to chytrá volba."'},{id:"Dialogue Text/0x0100000400007231",source:`"Sir, I didn't mean for this to happen. I'm sorry, this has always been a cop-friendly place..." The man seems shaken by the incident.`,target:'"Pane, nechtěl jsem, aby se to stalo. Omlouvám se, tohle bylo vždycky místo přátelské k policistům..." Muž se zdá být incidentem otřesen.',deepl:'"Pane, nechtěl jsem, aby se to stalo. Omlouvám se, ale tohle bylo vždycky místo přátelské k policistům..." Muž se zdá být incidentem otřesen.',lindat:'"Pane, nechtěl jsem, aby se to stalo. Omlouvám se, tohle bylo vždycky místo přátelské k policajtům..." Ten muž vypadá, že je tou událostí otřesen.',google:'"Pane, nechtěl jsem, aby se to stalo. Je mi líto, tohle bylo vždy místo přátelské k policistům..." Zdá se, že muž je incidentem otřesen.'},{id:"Dialogue Text/0x010000820001D8D7",source:`"Friday afternoon. When you first arrived. I got word the RCM was in town, then she came in to see me. Told me she was leaving. That's when we had our little... conversation."`,target:'"Páteční odpoledne. Když jsi poprvé přijel. Dostal jsem zprávu, že ROM je ve městě, a pak za mnou přišla. Řekla mi, že odjíždí. Tehdá jsme měli náš malý... rozhovor."',deepl:'"Páteční odpoledne. Když jsi poprvé přijel. Dostal jsem zprávu, že RCM je ve městě, a pak za mnou přišla. Řekla mi, že odjíždí. Tehdy jsme měli náš malý... rozhovor."',lindat:'"V pátek odpoledne. Když jste přijel poprvé. Dostal jsem zprávu, že RCM je ve městě, pak za mnou přijela. Řekla mi, že odjíždí. Tehdy jsme si trochu... popovídali."',google:'"V pátek odpoledne. Když jsi poprvé přijel. Dostal jsem zprávu, že RCM je ve městě, pak za mnou přišla. Řekla mi, že odchází. Tehdy jsme měli náš malý... rozhovor."'},{id:"Dialogue Text/0x0100008200017A01",source:"His hands become fists.",target:"Ruce se mu sevřou v pěst.",deepl:"Ruce se mu sevřou v pěst.",lindat:"Jeho ruce se mění v pěsti.",google:"Jeho ruce se stanou pěstmi."},{id:"Dialogue Text/0x0100005A000099AF",source:"Unlike the girl outside, however, the boys' breathing is regular, their jaws stay put, and their pupils aren't dilated. So they're not under the influence *currently*.",target:"Narozdíl od té dívky venku. Dech mladíků je pravidelný, jejich čelisti nehybné a zorničky nerozšířené. Takže nejsou *momentálně* pod vlivem.",deepl:"Na rozdíl od dívky venku však chlapci dýchají pravidelně, jejich čelisti zůstávají na místě a zorničky nejsou rozšířené. Nejsou tedy pod vlivem.",lindat:"Na rozdíl od dívky venku však chlapci dýchají pravidelně, čelisti drží na místě a zorničky nemají rozšířené. Nejsou tedy pod vlivem *momentálně*.",google:"Na rozdíl od dívky venku však chlapci dýchají pravidelně, čelisti zůstávají na místě a zorničky nemají rozšířené. Takže nejsou pod vlivem *aktuálně*."},{id:"Dialogue Text/0x01000029000006E2",source:`"And it shouldn't. Nature does not concern herself with ethical propositions. As a scientist, my interest is *strictly dispassionate*."`,target:'"A nemělo by. Příroda se nezabývá etickými propozicemi. Jako vědec se o ni zajímám *striktně nezaujatě*."',deepl:'"A nemělo by. Příroda se nezabývá etickými propozicemi. Jako vědec se o ni zajímám *přísně nezaujatě*."',lindat:'"A nemělo by. Příroda se etickými návrhy nezabývá. Jako vědec se zajímám *přísně nezaujatě*."',google:'"A nemělo by. Příroda se nezajímá o etické návrhy. Jako vědce je můj zájem *přísně nezaujatý*."'},{id:"Dialogue Text/0x0100005700016096",source:`"But they are working towards it! You're all doing very well here, relatively speaking." He gives you an approving nod.`,target:'"Ale pracují na tom! Jde vám to tu velmi dobře, relativně řečeno." Věnuje ti souhlasné přikývnutí.',deepl:'"Ale oni na tom pracují! Všichni si tu vedete relativně dobře." Souhlasně přikývne.',lindat:'"Ale pracují na tom! Relativně vzato se vám tady všem daří velmi dobře." Souhlasně na vás kývne.',google:'"Ale oni na tom pracují! Relativně vzato se vám tady všem daří velmi dobře." Dá vám souhlasné kývnutí.'},{id:"Dialogue Text/0x0100005A00012DFD",source:'"Child, converse with me."',target:'"Dítě, mluv se mnou."',deepl:'"Dítě, mluv se mnou."',lindat:'"Dítě, mluv se mnou."',google:'"Dítě, promluv si se mnou."'},{id:"Dialogue Text/0x0100005300001971",source:`"You've been saying that for a while. And yet, we only seem to be getting *further* from our actual goal..."`,target:'"To už jste už nějakou tu chvíli říkal. A přesto se zdá, že se od našeho cíle jen *vzdalujeme*..." ',deepl:'"To říkáš už nějakou dobu. A přesto se zdá, že se od našeho skutečného cíle jen vzdalujeme..."',lindat:'"To říkáš už nějakou dobu. A přesto se zdá, že se jen *vzdalujeme* od našeho skutečného cíle..."',google:'"Říkáš to už nějakou dobu. A přesto se zdá, že se jen dostáváme *dále* od našeho skutečného cíle..."'},{id:"Dialogue Text/0x010000570001E090",source:"...is red from the cold. She's breathing on her fingers clasping the plan. Traces of sadness are visible in her expression.",target:"...je rudá mrazem. Dýchá si na prsty svírající plán. V jejím výrazu jsou znatelné stopy smutku.",deepl:"...je zčervenalá zimou. Dýchá na prsty svírající plán. V jejím výrazu jsou patrné stopy smutku.",lindat:"...je červená od chladu. Dýchá na prsty a svírá plán. V jejím výrazu jsou patrné stopy smutku.",google:"...je červený od chladu. Dýchá na prsty a svírá plán. V jejím výrazu jsou patrné stopy smutku."},{id:"Dialogue Text/0x0100007500001287",source:'"..."',target:'"..."',deepl:'"..."',lindat:'"...',google:'"..."'},{id:"Dialogue Text/0x0100004500002C25",source:"Synapses can be rerouted. The mind takes a new shape.",target:"Synapse lze přesměrovat. Mysl dostává nový tvar.",deepl:"Synapse lze přesměrovat. Mysl dostává nový tvar.",lindat:"Synapsy mohou být přesměrovány. Mysl dostává novou podobu.",google:"Synapse lze přesměrovat. Mysl dostává nový tvar."},{id:"Actors/0x0100004B0000234D/Name",source:"DJ Flacio",target:"DJ Flacio",deepl:"DJ Flacio",lindat:"DJ Flacio",google:"DJ Flacio"},{id:"Dialogue Text/0x0100000F00014463",source:"(Search for something you can defend yourself with.)",target:"(Hledej něco, čím se můžeš bránit.)",deepl:"(Hledejte něco, čím se můžete bránit.)",lindat:"(Hledejte něco, s čím se můžete bránit.)",google:"(Hledejte něco, čím se můžete bránit.)"},{id:"Dialogue Text/0x0100005700021F23",source:`"Seems like I'm a little out of shape. Or maybe my palms were just slippery..."`,target:'"Zdá se, že jsem trochu z formy. Nebo mi možná jen kloužou dlaně..."',deepl:'"Zdá se, že jsem trochu z formy. Nebo mi možná jen kloužou dlaně..."',lindat:'"Vypadá to, že jsem trochu z formy. Nebo mi jen klouzaly dlaně..."',google:'"Zdá se, že jsem trochu z formy. Nebo mi možná jen klouzaly dlaně..."'},{id:"Dialogue Text/0x0100007000005C08",source:`"Don't you think that's what I'm *trying* to do?"`,target:'"Nemyslíte, že právě o to se *snažím*?"',deepl:'"Nemyslíš, že se o to právě snažím?"',lindat:'"Nemyslíš, že právě o to se *snažím*?"',google:'"Nemyslíš, že to je to, co se *snažím* udělat?"'},{id:"Dialogue Text/0x0100005A00007417",source:`"Yup." She squints her eyes a little. "They were pretty... I'm sorry we sold those."`,target:'"Jop." Trochu zamhouří oči. "Byly krásný... mrzí mě, že jsme je prodali."',deepl:'"Jo." Trochu přimhouří oči. "Byly pěkné... Mrzí mě, že jsme je prodali."',lindat:'"Jo." Trochu přimhouří oči. "Byly pěkné... Mrzí mě, že jsme je prodali."',google:'"Jo." Trochu přimhouří oči. "Byly krásné... Je mi líto, že jsme je prodali."'},{id:"Dialogue Text/0x0100000700014851",source:'"No gun is worth this risk..." (Slowly back away.)',target:'"Žádná pistole nestojí za takové riziko..." (Pomalu couvej.)',deepl:'"Žádná zbraň nestojí za takové riziko..." (Pomalu ustupuje.)',lindat:'"Žádná zbraň nestojí za takové riziko..." (Pomalu ustupte.)',google:'"Žádná zbraň nestojí za toto riziko..." (Pomalu ustupujte.)'},{id:"Dialogue Text/0x0100007500002E24",source:'"Yeah," she snaps out of the lull. "Nothing. Now the only thing left to do is to unmute the headphones."',target:'"Jo," vytrhne se z útlumu. "Nic. Teď už zbývá jen zapnout zvuk do sluchátek."',deepl:'"Jo," vytrhne se z útlumu. "Nic. Teď už zbývá jen odpojit sluchátka."',lindat:"„Jo,“ vyštěkne z klidu. „Nic. Teď už zbývá jen odmontovat sluchátka.“",google:'"Jo," vytrhne se z klidu. "Nic. Teď už zbývá jen zapnout sluchátka."'},{id:"Dialogue Text/0x0100005400000645",source:'"I can understand how you would mistake Jacob Irw for a powerful electric vortex."',target:'"Chápu, jak jste si mohl poplést Jakuba Irwa za mocný elektrický vír."',deepl:'"Chápu, že jste si Jacoba Irwa spletl se silným elektrickým vírem."',lindat:'"Chápu, jak jste si mohl Jacoba Irwa splést se silným elektrickým vírem."',google:'"Chápu, jak byste si Jacoba Irwa spletli s mocným elektrickým vírem."'},{id:"Dialogue Text/0x0100005A0000D47E",source:'"We can continue on an amiable path, right? No more misunderstandings, no more lies." He nods, smiling cautiously. "Before you go, is there anything else you need?"',target:'"Můžeme pokračovat na přátelské cestě, že? Už žádná nedorozumění, žádné lži." Přikývne a opatrně se usměje. "Než odejdeš, ještě něco?"',deepl:'"Můžeme pokračovat v přátelské cestě, že? Už žádná nedorozumění, žádné lži." Přikývne a opatrně se usměje. "Než odejdeš, potřebuješ ještě něco?"',lindat:'"Můžeme pokračovat v přátelské cestě, že? Už žádná nedorozumění, žádné lži." Přikývne a opatrně se usměje. "Než půjdete, potřebujete ještě něco?"',google:'"Můžeme pokračovat v přívětivé cestě, že? Už žádná nedorozumění, žádné lži." Přikývne a opatrně se usměje. "Než půjdeš, potřebuješ ještě něco?"'},{id:"Dialogue Text/0x0100007200009F28",source:"He was like a cleric, a shepherd.",target:"Byl jako klerik, pastýř.",deepl:"Byl jako klerik, pastýř.",lindat:"Byl jako duchovní, pastýř.",google:"Byl jako klerik, pastýř."},{id:"Dialogue Text/0x0100000B000007B8",source:'"What kind?"',target:'"Jakého typu?"',deepl:'"Jaký druh?"',lindat:'"Jakou?"',google:'"Jaký druh?"'},{id:"Dialogue Text/0x0100000F00007A20",source:"It smells like a pier, in other words. A completely ordinary pier, that provokes no ideological associations whatsoever.",target:"Jinými slovy, je to cítit jako molo. Úplně obyčejné molo, které nevyvolává žádné ideologické asociace.",deepl:"Jinými slovy, voní to jako molo. Úplně obyčejné molo, které nevyvolává žádné ideologické asociace.",lindat:"Jinými slovy, voní to jako molo. Úplně obyčejné molo, které nevyvolává žádné ideologické asociace.",google:"Voní to jako molo, jinými slovy. Úplně obyčejné molo, které nevyvolává vůbec žádné ideologické asociace."},{id:"Dialogue Text/0x0100004D00003A66",source:"A burly man hangs out by the water lock, carving up a generous serving of salami with an old hunter's knife. His eyes are fixed on a man stranded on the other side of the water lock -- and on an enormous billboard that has fallen down into the canal between them.",target:" U zdymadla postává mohutný muž, starým loveckým nožem si ukrajuje štědrou porci salámu. Jeho oči se upírají na muže stojíciho na opačném břehu -- a na obrovskou ceduli blokující zdymadlo a kanál, který je mezi nimi.",deepl:"U vodního uzávěru se potlouká statný muž a starým loveckým nožem si krájí velkorysou porci salámu. Jeho oči se upírají na muže, který uvízl na druhé straně plavební komory - a na obrovský billboard, který spadl do kanálu mezi nimi.",lindat:"U vodní komory se poflakuje statný muž a starým loveckým nožem si porcuje štědrou porci salámu. Oči upírá na muže, který uvízl na druhé straně vodní komory – a na obrovský billboard, který spadl do kanálu mezi nimi.",google:"U vodní komory se poflakuje statný muž a starým loveckým nožem krájí velkorysou porci salámu. Jeho oči jsou upřeny na muže, který uvízl na druhé straně vodní komory - a na obrovský billboard, který spadl do kanálu mezi nimi."},{id:"Dialogue Text/0x0100005A00011A92",source:'"What about people from the Coalition? The so-called moralists?"',target:'"Co takhle lidé z Koalice? Takzvaní moralisté?"',deepl:'"A co lidé z Koalice? Takzvaní moralisté?"',lindat:'"A co lidé z Koalice? Ti takzvaní moralisté?"',google:'"A co lidé z Koalice? Takzvaní moralisté?"'},{id:"Items/novelty_cheque/DisplayName",source:"Giant Novelty Cheque",target:"Obří dárkový šek",deepl:"Obří novinkový šek",lindat:"Giant Novelty Cheque",google:"Obří novinka Check"},{id:"Dialogue Text/0x0100008E000000BD",source:'"Talking to him, I realized that sobriety can be pretty *hard core*, too. I gotta respect it..."',target:'"Když jsem se s ním bavil, tak jsem si uvědomil, že i střízlivost může být dost *hard core*. To musím respektovat..."',deepl:'"Když jsem s ním mluvil, uvědomil jsem si, že střízlivost může být také pěkně *tvrdá*. Musím to respektovat..."',lindat:'"Když jsem s ním mluvil, uvědomil jsem si, že střízlivost může být taky pěkně *tvrdé jádro*. Musím to respektovat..."',google:'"Když jsem s ním mluvil, uvědomil jsem si, že střízlivost může být taky pěkně *tvrdé jádro*. Musím to respektovat..."'},{id:"Dialogue Text/0x0100004500020BF7",source:"She observes your eyes scanning the horizon, then breaks the silence, slowly.",target:"Pozoruje, jak očima sleduješ obzor, a pak pomalu přeruší ticho.",deepl:"Pozoruje tvé oči, jak sledují obzor, a pak pomalu přeruší ticho.",lindat:"Pozoruje tvé oči, jak zkoumají obzor, pak ticho pomalu přeruší.",google:"Pozoruje, jak vaše oči skenují obzor, pak pomalu prolomí ticho."},{id:"Dialogue Text/0x0100000600010787",source:"Already did that. Evrart's money wasn't gonna last forever. You need more. Every day is a new expense!",target:"To už jsi udělal. Evrartovy peníze ti nevydržely věčně. Potřebuješ víc. Každý den jsou tu nové výdaje!",deepl:"To už jsem udělal. Evrartovy peníze by nevydržely věčně. Potřebuješ víc. Každý den jsou to nové výdaje!",lindat:"To už jsem udělal. Evrartovy peníze by nevydržely věčně. Potřebuješ víc. Každý den je nový výdaj!",google:"Už jsem to udělal. Evrartovy peníze nevydrží věčně. Potřebuješ víc. Každý den je nový výdaj!"},{id:"Dialogue Text/0x0100008100003EBA",source:"THE MODULATIONS OF MY VOICE ARE NOTED DOWN WITH THERMOMETERS AND BAROMETERS. YOU FEEL ME IN YOUR NOSTRILS, ON THE LITTLE HAIRS ON THE BACK OF YOUR NECK.",target:"MODULACE MÉHO HLASU JSOU ZAZNAMENÁNY POMOCÍ TEPLOMĚRŮ A BAROMETRŮ. CÍTÍŠ MĚ V NOSNÍCH DÍRKÁCH, NA CHLOUPCÍCH NA ZÁTYLKU.",deepl:"MODULACE MÉHO HLASU JSOU ZAZNAMENÁNY POMOCÍ TEPLOMĚRŮ A BAROMETRŮ. CÍTÍŠ MĚ V NOSNÍCH DÍRKÁCH, NA CHLOUPCÍCH NA ZÁTYLKU.",lindat:"MODULACE MÉHO HLASU JSOU OZNAMOVÁNY S TERAMOMETRY A BAROMETRY. UŽÍVÁTE MĚ VE SVÝCH NOSTRILÁCH, NA MALÝCH VLASÍCH NA ZÁKLADĚ SVÉHO NECKU.",google:"MODULACE MÉHO HLASU JSOU ZAHRNUTY TEPLOMĚRY A BAROMETRY. CÍTÍŠ MĚ VE SVÝCH NOSNÍCH, NA VLÁSKÁCH NA ZADNĚ KRKU."},{id:"Dialogue Text/0x0100008E00004CC3",source:`"Now, let's tally up the scores, shall we?"`,target:'"A teď sečteme skóre, ano?"',deepl:'"A teď sečteme skóre, ano?"',lindat:'"A teď si sečteme skóre, ano?"',google:'"A teď sečteme skóre, ano?"'},{id:"Dialogue Text/0x0100002700001317",source:'The lieutenant shoots you a sideways glance. "And I am his private partner, John... Shao. Together we run the pre-eminent spousal surveillance firm in Revachol."',target:'Poručík po tobě střelí pohledem. "A já jsem jeho soukromý partner, Jan... Šao. Společně vedeme nejvýznamnější firmu na sledování manželů v Revacholu."',deepl:'Poručík po tobě střelí pohledem. "A já jsem jeho soukromý partner, Johne... Shao. Společně vedeme nejvýznamnější firmu na sledování manželů v Revacholu."',lindat:'Poručík po vás střelí postranním pohledem. "A já jsem jeho soukromý partner, John... Shao. Společně řídíme přední manželskou firmu na sledování v Revacholu."',google:"Poručík na vás vrhne boční pohled. „A já jsem jeho soukromý partner, Johne... Shao."},{id:"Dialogue Text/0x0100000600014AAA",source:'"I am trying to ask Revachol."',target:'"Snažím se ptát Revacholu."',deepl:'"Snažím se zeptat Revachola."',lindat:'"Snažím se zeptat Revachola."',google:'"Snažím se zeptat Revachola."'},{id:"Dialogue Text/0x0100004C0000CB23",source:`"I'm going to take off now." [Leave.]`,target:'"Tak já mizím." [Odejdi.]',deepl:'"Teď odlétám." [Odejít.]',lindat:"„Já teď odstartuju.“ [Odejdi.]",google:'"Teď vzlétnu." [Odejít.]'},{id:"Dialogue Text/0x0100007000000082",source:'"Yes?"',target:'"Ano?"',deepl:'"Ano?"',lindat:'"Ano?"',google:'"Ano?"'},{id:"Dialogue Text/0x010000450001B381",source:`"This is ballistics. She's left a trajectory for us..." The lieutenant tests the thread with his finger. Drawn taut, it rebounds instantly.`,target:'"Tohle je balistika. Zanechala nám trajektorii..." Poručík zkouší vlákno prstem. Je napnuté, okamžitě se odrazí.',deepl:'"Tohle je balistika. Zanechala nám trajektorii..." Poručík zkouší vlákno prstem. Napnuté se okamžitě odrazí.',lindat:'"Tohle je balistika. Nechala nám trajektorii..." Poručík prstem zkouší nit. Napnutá, okamžitě se odrazí.',google:'"To je balistika. Zanechala nám trajektorii..." Poručík zkouší nit prstem. Natažený, okamžitě se odrazí.'},{id:"Dialogue Text/0x01000027000009A3",source:"I can try to. (Try to stop.)",target:"Mohu se o to pokusit. (Zkus přestat.)",deepl:"Mohu se o to pokusit. (Zkusit přestat.)",lindat:"Můžu to zkusit. (Zkus přestat.)",google:"Můžu to zkusit. (Zkuste přestat.)"},{id:"Dialogue Text/0x0100000700014D44",source:"Her scratched skin is warm to the touch, but the person inside doesn't even know you're there.",target:"Její rozškrábaná kůže je na dotek teplá, ale osoba uvnitř ani neví, že tu jsi.",deepl:"Její poškrábaná kůže je na dotek teplá, ale osoba uvnitř ani neví, že tam jsi.",lindat:"Její poškrábaná kůže je teplá na dotek, ale člověk uvnitř ani neví, že tam jsi.",google:"Její poškrábaná kůže je teplá na dotek, ale člověk uvnitř ani neví, že tam jste."},{id:"Dialogue Text/0x010000060001BDF7",source:`"I really *must* insist you buy one of the books." You're interrupted by the shopkeep. "Reading them is not for free. Do still browse though. But not too *long*."`,target:'"Opravdu musím trvat na tom, abyste si jednu z těch knih koupil." Přeruší tě prodavačka. "Jejich čtení není zadarmo. Přesto si je prohlédněte. Ale ne moc dlouho*."',deepl:'"Opravdu musím trvat na tom, aby sis jednu z těch knih koupil." Přeruší tě prodavač. "Jejich čtení není zadarmo. Přesto si je prohlédněte. Ale ne moc dlouho."',lindat:'"Opravdu *musím* trvat na tom, abyste si jednu z těch knih koupil." Přeruší vás prodavač. "Čtení není zadarmo. Přesto si je pořád prohlížte. Ale ne moc *dlouho*."',google:'"Opravdu *musím* trvat na tom, abyste si koupili jednu z knih." Jste vyrušeni prodavačkou. "Čtení není zadarmo. Přesto procházejte. Ale ne příliš *dlouho*."'},{id:"Dialogue Text/0x0100000F0000E81A",source:"The radio appreciates your restraint. It buzzes contentedly.",target:"Rádio ocení tvoji sebekázeň. Spokojeně bzučí.",deepl:"Rádio oceňuje vaši zdrženlivost. Spokojeně bzučí.",lindat:"Rádio oceňuje vaši zdrženlivost. Spokojeně bzučí.",google:"Rádio oceňuje vaši zdrženlivost. Spokojeně to bzučí."},{id:"Dialogue Text/0x0100007000004238",source:"Would you like to try again?",target:"Chceš to zkusit znovu?",deepl:"Chcete to zkusit znovu?",lindat:"Chcete to zkusit znovu?",google:"Chtěli byste to zkusit znovu?"},{id:"Dialogue Text/0x0100007200009B26",source:"So that's why he's 'the deserter.'",target:"Takže to je ten důvod, proč je 'dezertér'.",deepl:'Proto je "dezertér".',lindat:"Tak proto je to 'dezertér'.",google:"Takže to je důvod, proč je 'dezertér'."},{id:"Dialogue Text/0x010000580000F871",source:"Giving away all of your possessions,  sacrificing a limb to appease an angry god, trying to live on air and light alone as though you were some kind of plant...",target:"Rozdat všechen svůj majetek, obětovat končetinu, abys uklidnil rozhněvaného boha, snažit se žít jen ze vzduchu a světla, jako bys byl nějaká rostlina...",deepl:"Rozdat všechen svůj majetek, obětovat končetinu, abys usmířil rozhněvaného boha, snažit se žít jen ze vzduchu a světla, jako bys byl nějaká rostlina...",lindat:"Rozdáváte veškerý svůj majetek, obětujete úd, abyste uspokojili rozzlobeného boha, snažíte se žít jen na vzduchu a na světle, jako byste byli nějaká rostlina...",google:"Vzdát se všeho svého majetku, obětovat úd, abys uklidnil rozhněvaného boha, snažit se žít jen na vzduchu a světle, jako bys byl nějaký druh rostliny..."},{id:"Dialogue Text/0x0100006B000036A9",source:`"Easy, now. They're just chaincutters."`,target:'"V klidu. Jsou to jen štípací kleště."',deepl:'"Klid. Jsou to jen řezníci řetězů."',lindat:'"Jen klid. Jsou to jen řetězaři."',google:'"Klid, teď. Jsou to jen řezači řetězů."'},{id:"Dialogue Text/0x0100008200018499",source:`"Why don't we make it FORTY, huh?" The man shouts from behind the counter. "Why don't we make it A HUNDRED beers, you're not loud enough!"`,target:'"Co takhle udělat ČTYŘICET, co?" Muž křičí zpoza pultu. "Proč ne STO piv, ještě nejste dost hlasití!"',deepl:'"Co kdybychom jich udělali čtyřicet?" Muž zpoza pultu vykřikne. "Proč z toho neuděláme STO piv, nejste dost hlasitý!"',lindat:'"Proč to neuděláme čtyřicetkrát, co?" Muž křičí zpoza pultu. "Proč z toho neuděláme piva, nejsi dost hlasitý!"',google:'"Proč to neuděláme ČTYŘICET, co?" křičí muž zpoza pultu. "Proč z toho neuděláme STO piv, nejsi dost nahlas!"'},{id:"Dialogue Text/0x0100008100004F7C",source:'"Just one or two more, Lena. Pretty please?"',target:'"Ještě jeden nebo dva, Leno. Pěkně prosím?"',deepl:'"Ještě jeden nebo dva, Leno. Prosím?"',lindat:'"Ještě jednu nebo dvě, Leno. Pěkně prosím?"',google:'"Ještě jeden nebo dva, Leno. Hezky prosím?"'},{id:"Dialogue Text/0x0100007500002E2B",source:`"Yeah," she snaps out of the lull. "Let's do it. Now the only thing left to do is to unmute the headphones."`,target:'"Jo," vytrhne se z útlumu. "Pojďme na to. Teď už zbývá jen zapnout zvuk do sluchátek."',deepl:'"Jo," vytrhne se z útlumu. "Pojďme na to. Teď už zbývá jen odpojit sluchátka."',lindat:"„Jo,“ vyštěkne z klidu. „Jdeme na to. Teď už zbývá jen odmontovat sluchátka.“",google:'"Jo," vytrhne se z klidu. "Pojďme na to. Teď už zbývá jen zapnout sluchátka."'},{id:"Dialogue Text/0x0100000700014446",source:"No. A strange feeling fills your gut and suddenly you *know* the gun is empty. Thinking about it makes you nauseous.",target:"Ne. Zvláštní pocit ti zaplní útroby a najednou víš, že zbraň je prázdná. Při pomyšlení na to se ti udělá nevolno.",deepl:"Ne, naplní vás zvláštní pocit a najednou víte, že je zbraň prázdná. Při pomyšlení na to se vám udělá nevolno.",lindat:"Ne. Naplní vás zvláštní pocit a najednou *víte* že je pistole prázdná. Když na to pomyslíte, zvedá se vám žaludek.",google:"Ne. Zvláštní pocit naplní tvé útroby a najednou *víš*, že zbraň je prázdná. Při pomyšlení na to se vám dělá nevolno."},{id:"Dialogue Text/0x0100006B00001775",source:'"Fuck does Cuno know?" He shrugs his shoulders. "Cuno would use it to bring shit to the island."',target:'"Jak to má Kuno, do prdele, vědět?" Pokrčí rameny. "Kuno by tím tahal věci na ostrov."',deepl:'"Kurva, ví to Cuno?" Pokrčí rameny. "Cuno by to použil, aby na ostrov přivezl hovno."',lindat:"„Kurva, ví to Cuno?“ Pokrčí rameny. „Cuno by to použil, aby na ostrov dopravil hovna.“",google:'"Kurva, Cuno to ví?" Pokrčí rameny. "Cuno by to použil, aby přinesl hovno na ostrov."'}],u=e("h1",{id:"nahodny-vyber-–-disco-elysium",tabindex:"-1"},[o("Náhodný výběr – Disco Elysium "),e("a",{class:"header-anchor",href:"#nahodny-vyber-–-disco-elysium","aria-hidden":"true"},"#")],-1),m=e("h2",{id:"testovaci-sada-01",tabindex:"-1"},[o("Testovací sada 01 "),e("a",{class:"header-anchor",href:"#testovaci-sada-01","aria-hidden":"true"},"#")],-1),p=e("h2",{id:"testovaci-sada-02",tabindex:"-1"},[o("Testovací sada 02 "),e("a",{class:"header-anchor",href:"#testovaci-sada-02","aria-hidden":"true"},"#")],-1),v=e("h2",{id:"testovaci-sada-03",tabindex:"-1"},[o("Testovací sada 03 "),e("a",{class:"header-anchor",href:"#testovaci-sada-03","aria-hidden":"true"},"#")],-1),b=JSON.parse('{"title":"Náhodný výběr – Disco Elysium","titleTemplate":"Náhodný výběr","description":"","frontmatter":{"titleTemplate":"Náhodný výběr"},"headers":[{"level":2,"title":"Testovací sada 01","slug":"testovaci-sada-01","link":"#testovaci-sada-01","children":[]},{"level":2,"title":"Testovací sada 02","slug":"testovaci-sada-02","link":"#testovaci-sada-02","children":[]},{"level":2,"title":"Testovací sada 03","slug":"testovaci-sada-03","link":"#testovaci-sada-03","children":[]}],"relativePath":"disco.md"}'),k={name:"disco.md"},z=Object.assign(k,{setup(h){return(c,j)=>(l(),i("div",null,[u,m,a(t,{data:n(s)},null,8,["data"]),p,a(t,{data:n(r)},null,8,["data"]),v,a(t,{data:n(d)},null,8,["data"])]))}});export{b as __pageData,z as default};
